" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Zofenopril: International drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F10150226\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Bifril (AT, DE, DK, FI, GB, IE, IS, NO, SE);",
"     </li>",
"     <li>",
"      Teoula (FR);",
"     </li>",
"     <li>",
"      Zofenil (AT, BE, DE, DK, ES, FI, FR, GB, IE, IS, LU, NO, PT, SE);",
"     </li>",
"     <li>",
"      Zofepril (GR, IT);",
"     </li>",
"     <li>",
"      Zofil (NL);",
"     </li>",
"     <li>",
"      Zopranol (BE, ES, GR, LU, NL, PT)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F10150227\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Angiotensin-Converting Enzyme (ACE) Inhibitor",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F10150248\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Management of hypertension; treatment of acute anterior wall myocardial infarction",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F10150250\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oral: Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Acute anterior wall myocardial infarction: Begin 24 hours after onset of symptoms and continue dose for 6 weeks; initial: 7.5 mg every 12 hours for 2 days, then 15 mg every 12 hours for 2 days, then 30 mg every 12 hours; target dose: 30 mg every 12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Hypertension: Initial: 15 mg once daily, may increase dose at 4-week intervals; usual effective dose: 30 mg once daily; maximum daily dose: 60 mg/day, administer once daily or in two divided doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     <b>",
"      Note:",
"     </b>",
"     Diuretics should be discontinued 2-3 days prior to initiating zofenopril, if possible. Restart diuretic after blood pressure is stable, if needed. If diuretic can be discontinued prior to therapy, begin with 15 mg/day with close supervision until stable blood pressure. Start dose at 7.5 mg/day if these measures cannot be taken.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;\">",
"     <b>",
"      Dosage adjustment in renal impairment:",
"     </b>",
"     Hypertension:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &le;45 mL/minute: Decrease daily dosage by 50%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &gt;45 mL/minute: No adjustment required",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Dialysis: Initial and maintenance dose: Decrease dose by 75%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Dosage adjustment in hepatic impairment:",
"     </b>",
"     Hypertension:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Mild-to-moderate impairment: Decrease daily dosage by 50%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Severe impairment: Use is contraindicated",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821248\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F10150251\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Tablet: 7.5 mg, 30 mg, 60 mg",
"    </p>",
"   </div>",
"  </div>",
"  <div id=\"topicAgreement\">",
