var title_f22_27_22970="Sexual maturity rating of breast development in girls";
var content_f22_27_22970=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72038%7EPEDS%2F79782%7EPEDS%2F80005&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72038%7EPEDS%2F79782%7EPEDS%2F80005&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sexual maturity rating (Tanner staging) of breast development in girls",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 329px; height: 570px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Stages in breast development in girls.",
"    <br>",
"     Stage 1: Prepubertal, with no palpable breast tissue.",
"     <br>",
"      Stage 2: Development of a breast bud, with elevation of the papilla and enlargement of the areolar diameter.",
"      <br>",
"       Stage 3: Enlargement of the breast, without separation of areolar contour from the breast.",
"       <br>",
"        Stage 4: The areola and papilla project above the breast, forming a secondary mound.",
"        <br>",
"         Stage 5: Recession of the areola to match the contour of the breast; the papilla projects beyond the countour of the areola and breast.",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"          Figure from: Roede MJ, van Wieringen JC. Growth diagrams 1980: Netherlands third nation-wide survey. Tijdschr Soc Gezondheids 1985; 63:1. Reproduced with permission from the author.",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sexual maturity rating (Tanner staging) of pubic hair development in girls",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 379px; height: 564px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Stages of development in pubic hair in girls.",
"    <br>",
"     Stage 1: Prepubertal with no pubic hair.",
"     <br>",
"      Stage 2: Sparse, straight hair along the lateral vulva.",
"      <br>",
"       Stage 3: Hair is darker, coarser, and curlier, extending over the mid-pubis.",
"       <br>",
"        Stage 4: Hair is adult-like in appearance, but does not extend to the thighs.",
"        <br>",
"         Stage 5: Hair is adult in appearance, extending from thigh to thigh.",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"          Figure from: Roede MJ, van Wieringen JC. Growth diagrams 1980: Netherlands third nation-wide survey. Tijdschr Soc Gezondheids 1985; 63:1. Reproduced with permission from the author.",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Sexual maturity rating (Tanner staging) of pubic hair development in boys",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 347px; height: 542px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Stages of pubic hair development in boys. Stage 1: Prepubertal, with no pubic hair. Stage 2: Sparse, straight pubic hair along the base of the penis. Stage 3: Hair is darker, coarser, and curlier, extending over the mid-pubis. Stage 4: Hair is adult-like in appearance, but does not extend to thighs. Stage 5: Hair is adult in appearance, extending from thigh to thigh.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Figure from: Roede MJ, van Wieringen JC. Growth diagrams 1980: Netherlands third nation-wide survey. Tijdschr Soc Gezondheids 1985; 63:1. Reproduced with permission from the author.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
