" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Factors used to predict relapse in Graves' disease during thionamide therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Subnormal serum TSH concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blunted response of serum TSH to TRH administration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High serum concentrations of TSH-receptor antibodies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High serum ratio of T3 to T4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Persistent radioiodine uptake during exogenous thyroid hormone administration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High serum thyroglobulin concentrations during exogenous thyroid hormone administration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High serum IgE concentrations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HLA-DR3 and persistence of TSH-receptor antibodies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HLA-D3 allele DQA2U",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypoechogenicity on thyroid ultrasonography",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        GG genotype and gallele at position 49 in exon 1 of the cytotoxic T cell lymphocyte associated molecule-4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Heterogeneous TSH-receptor antibody epitopes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inferior thyroid artery blood flow (Doppler)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
