var content_f22_27_22972=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72816&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72816&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of polycystic ovary syndrome (PCOS) in adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Virilizing congenital adrenal hyperplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Nonclassic 21-hydroxylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Classic 21-hydroxylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 11&beta;-hydroxylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 3&beta;-hydroxysteroid dehydrogenase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Congenital ACTH-dependent forms of adrenal hyperandrogenism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Glucocorticoid resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Cortisone reductase deficiency&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Sulfotransferase 2A deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Cushing syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Virilizing adrenal or ovarian tumor&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Ovarian steroidogenic blocks&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperprolactinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insulin resistance syndromes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acromegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thyroid dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Androgenic drugs (eg, anabolic steroids)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Valproic acid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Other rare causes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Disorders of sex development",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Portohepatic shunting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <span class=\"sublist1_start\">",
"        </span>",
"        Obesity&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Idiopathic&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Idiopathic hyperandrogenemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Idiopathic hirsutism&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ACTH: adrenocorticotropic hormone.",
"    </div>",
"    <div class=\"reference\">",
"     Modified&nbsp;from: Buggs C, Rosenfield RL. Polycystic ovary syndrome in adolescence. Endocrinol Metab Clin North Am 2005; 34:677.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
